Templates.template:
setDefaultHandlers(
	{
		asyncDescriptionHandler: ${fn_asyncDescriptionHandler}, // function
		asyncURLHandler: ${fn_asyncURLHandler} // function
	}
)

new sap.m.routing.Router(
	"${oRoutes}", // object|object[]
	{
		async: ${bAsync} // boolean
	},
	"${oOwner}", // sap.ui.core.UIComponent
	"${oTargetsConfig}" // object
)

new sap.m.routing.Targets(
	{
		views: ${views}, // sap.ui.core.routing.Views
		config: ${config}, // object
		targets: ${targets} // object
	}
)

